import SearchBar from "../components/SearchBar";
import Grid from "@material-ui/core/Grid";
import HomeCard from "../components/HomeCard";
import HomeCardArr from "../HomeArticle";
import Container from "@material-ui/core/Container";
import { useHistory } from "react-router-dom";
import Typography from "@material-ui/core/Typography";
import Box from "@material-ui/core/Box";

const Home = ({ handleSubmit }) => {
	const history = useHistory();
	const handleClick = (e) => {
		if (e.target.className !== "search_home") {
			return;
		} else {
			history.push("/search_result");
		}
	};
	return (
		<header>
			<Box display="flex">
				<Typography>Where To Park?</Typography>
			</Box>

			<div className="home">
				<Container className="search_home" onClick={handleClick}>
					<SearchBar handleSubmit={handleSubmit} />
				</Container>

				<article>
					<Container>
						<Grid container direction="row" justify="space-around">
							{HomeCardArr.map((element, index) => (
								<Grid item xs={12} md={6} key={index}>
									<HomeCard element={element} key={index} />
								</Grid>
							))}
						</Grid>
					</Container>
				</article>
			</div>
		</header>
	);
};

export default Home;
